import React from "react";
function Square(props){

    const cc =(i)=>{
        console.log(i);
    }
    return(
        <div className="square">
            <button className="sqr" onClick={()=>cc(props.index)}>{props.curen}</button>
        </div>
    )
}

export default Square;
